English | CBR | 32 Pages

Teen Titans v4 Annual #2
Publisher:  DC Comics
Publication Date:  October 30, 2013

Writer:  Scott Lobdell
Pencillers:  Barry Kitson
Inkers:  Art Thibert, Jesus Merino, Scott Hanna, and Barry Kitson
Colorist:  Pete Pantazis
Letterer:  Travis Lanham
Cover:  Eddy Barrows, Eber Ferreira, and Pete Pantazis

The Teen Titans continue their trip through time as the team must confront Jon Lane Kent, the Superboy of the future, who could one day wipe out the most powerful heroes on Earth. Can the Titan's Superboy defeat the man he was cloned from by Harvest?

Thanks goes to Shining Knight for this release.

